function Home() {
  return (
    <div>
      <h1> About Me</h1>
      <p className="mw-50">
        My name is Solomon Dorsey I am a Web Developer. I graduated from the
        UPENN LPS Full Stack coding bootcamp, and am a biologist from Loyola
        University Maryland.
      </p>
    </div>
  );
}
export default Home;
